import "./Header.css";
import { Link } from "react-router-dom";
import AllFavorites from "../../pages/AllFavorites/AllFavorites";

function Header(props) {
  return (
    <div className="Header">
      <nav>
        <ul>
          <li>
            <Link>Home</Link>
          </li>
          <li>
            <Link to="/All-Favorites">AllFavorites</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Header;
